import React from 'react';
import './main-news.css'
import NewsItem from "../news-item";
const MainNews = ({news}) => {
    const {
            author='',
            title,
            description,
            url,
            urlToImage,
            publishedAt
    } = news;
    return (
        <div className="d-block">
            <NewsItem
                author={author}
                title={title}
                description={description}
                url={url}
                urlToImage={urlToImage}
                publishedAt={publishedAt}
            />
        </div>
    );
};
export default MainNews;
